import React from 'react'

function Navbar() {
    const nav = [
        {
            "title":"Syndico",
            "link":""
        },
        {
            "title":"Module",
            "link":""
        },
        {
            "title":"Contact",
            "link":""
        },
    ]
  return (
    <>
    <div className='navbar'>
        <logo>
            <img src="/images/syndico.png" />
        </logo>
        <ul>
            {nav.map((item,key)=>(
                <li key={key+1}> <h3> {item.title} </h3> </li>
            ))}
            <li> <i class="fa-solid fa-globe"></i> </li>
        </ul>
    </div>
    </>
  )
}

export default Navbar
